description:
Ministry of health and social services of Namibia on December 23, 2020 published a regulation, stating that a person may not leave his or her place of residence between 21:00 and 04:00 on each day. Purposes for which people may leave their homes:
(a) providing a critical service;
(b) seeking medical assistance;
(c) seeking assistance from law enforcement agencies; or
(d) attending to any other emergency situation that could not be reasonably avoided

According to the regulation of Namibian president that ws published on March 28, 2020
every person who -
a) is not a Namibian citizen;
b) does not hold a permanent residence permit for Namibia;
c) is not domiciled in Namibia or otherwise lawfully resident in Namibia
d) is not part of team of medical personnel that is required to provide medical services in Namibia to alleviate the COVID-19 pandemic;
e) is not a member of the diplomatic or consular staff of a country that is accredited to Namibia or in transit to another country; or
f) is not a spouse or child of a person referred to in paragraphs (a) to (e), must, during the period of
lockdown, be refused entry into Namibia under section 10 of the Immigration Control Act

President of Namibia proclaimed on August 29, 2020 that every person who -
(a) is not a Namibian citizen;
(b) does not hold a permanent residence permit for Namibia;
(c) is not domiciled in Namibia or otherwise lawfully resident in Namibia;
(d) is not part of a team of medical personnel that is required to provide medical services in Namibia to alleviate the COVID-19 pandemic;
(e) is not a member of the diplomatic or consular staff of a country that is accredited to Namibia or in transit to another country; or
(f) is not a spouse or child of a person referred to in paragraphs (a) to (e),must, during the specified period, be refused entry into Namibia under section 10 of the Immigration Control Act

