On the 31st of July 2020, Namibian president delivered a presidental address stating that the other 13 regions of the country will remain under STAGE 4 level of restrictions, with the following revised measures to curb the spread of the virus. The public must strictly adhere to the regulations and Health & Hygiene protocols, which are our first line of defense. Members of the public must:
(a) Wear a mask at all times in public spaces;
(b) Maintain social distancing;
(c) Avoid crowded public gatherings; and
(d) Avoid unnecessary travel to and from different parts of the country.

