President of Namibia enforced a policy on August 25, 2020 and it will end at 24.00 on September 17, 2020. According to it, an authorised health official must place the following persons under mandatory supervised quarantine at a designated quarantine facility for such period as determined in the Ministry‚Äôs guidelines:
(a)	 contacts of a confirmed case of COVID-19, at the cost of the State subject to subregulation (2) and the cost obligation requirements set out in the COVID-19 General Regulations provisions;
(b) health care workers that have been in contact, or are considered by the authorised health official to have been in contact, with a confirmed case of COVID-19, at the cost of the respective employer of the health care worker;
(c) cross-border drivers, and other persons arriving in Namibia by road, railway, sea or air whose stay in the country is longer than the period specified in the Ministry‚Äôs guidelines, subject to the cost obligation requirements set out in the COVID-19 General Regulations provisions; and
(d) persons entering Namibia in the circumstances contemplated in the relevant provisions of the COVID-19 General Regulations, subject to the cost obligation requirements set out in those regulations

