President of Namibia allowed a member of a diplomatic mission or a consular post  to quarantine at his or her respective place of residence or other place of choice, but (s)he must 
(a) strictly comply with the quarantine procedures set out in these regulations and in any guidelines issued by the Ministry and the applicable WHO guidelines;
(b) notify the ministry responsible for international relations and co-operation of his or her arrival 10 days in advance as well as provide information of the quarantine facility of choice, including the address;
(c) strictly adhere to the infection prevention and control guidelines as per the guidelines of the Ministry and social distancing;
(d) not allow any person to visit him or her while under quarantine; and
(e) remain at his or her residence or place of choice during the period of quarantine and not leave the residence or place where quarantined.
This policy was enforced on August 25, 2020

