Ministry of Health and Social Services of Namibia enforced a mandatory quarantine for all people entering the state at their own cost. However, these categories may be quarantined at the cost of the state:
(a) Namibian citizens who are -
(i) students enrolled for and undertaking a course of study at a school or an
educational institution in Namibia or in a foreign country, on entering or
leaving Namibia;
(ii) State patients, on entering or leaving Namibia;
b) health professionals employed by the state and on official duty, on entering or leaving Namibia;
(c) persons entering Namibia to provide humanitarian assistance;
d) persons entering Namibia on official government business, and in the case of Namibian government official on official duty, on entering or leaving Namibia;
This regulation comes into force on September 23, 2020

Ministry of Health and Social Services of Namibia may quarantine the next categories at the cost of the State:
(a) Namibian citizens who are -
(i) students enrolled for and undertaking a course of study at a school or aneducational institution in Namibia or in a foreign country, on entering orleaving Namibia;
(ii) State patients, on entering or leaving Namibia;
(b)	 health professionals employed by the State and on official duty, on entering or leaving Namibia;
(c) persons entering Namibia to provide humanitarian assistance;
(d)	 persons entering Namibia on official government business, and in the case of Namibian government officials on official duty, on entering or leaving Namibia; or
(e)	 such persons as may be specified in the directives.

This policy comes into force on May 1, 2021  cease to have effect at 24:00 on 31 May 2021
